import React from "react";
import GlobalStyles from "../../styles/global";
import styled from "styled-components";

const Wrapper = styled.div`
  background: linear-gradient(to bottom, #ffc5c5, #ff4949);
  height: 100%;
`;


function App() {
  return (
    <>
      <GlobalStyles />
      <Wrapper></Wrapper>
    </>
  );
}

export default App;
